import React from 'react';
import Friend from './friend.js';

const SingleFriend = props => {
  let friend = props.friends.find(theFriend => {
    if (theFriend.id === Number(props.match.params.id)) {
      return theFriend;
    }
  });
  return (
    <Friend
      {...props}
      name={friend.name}
      age={friend.age}
      email={friend.email}
      key={friend.id}
      id={friend.id}
    />
  );
};

export default SingleFriend;
